oad
),
raw_rows as (
  select jsonb_array_elements(payload) as row
  from raw_json
),
prepared as (
  select
    org.id as organization_id,
    lower(trim(row->>'email')) as email,
    nullif(row->>'staff_id', '') as staff_id,
    nullif(row->>'first_name', '') as first_name,
    nullif(row->>'middle_name', '') as middle_name,
    nullif(row->>'last_name', '') as last_name,
    nullif(row->>'full_name', '') as full_name,
    nullif(row->>'phone', '') as phone,
    nullif(row->>'street', '') as street,
    nullif(row->>'city', '') as city,
    nullif(row->>'state', '') as state,
    nullif(row->>'zip_code', '') as zip_code,
    nullif(row->>'facility', '') as facility,
    nullif(row->>'employee_type', '') as employee_type,
    nullif(row->>'title', '') as title,
    case
      when lower(coalesce(row->>'status', '')) in ('active', 'inactive', 'on_hold', 'discharged')
        then lower(row->>'status')
      else 'inactive'
    end as status_value,
    nullif(row->>'time_zone', '') as time_zone,
    nullif(row->>'npi_number', '') as npi_number,
    nullif(row->>'medicaid_id', '') as medicaid_id,
    nullif(row->>'practitioner_id', '') as practitioner_id,
    nullif(row->>'taxonomy_code', '') as taxonomy_code,
    nullif(row->>'supervisor', '') as supervisor,
    coalesce(array(select jsonb_array_elements_text(row->'languages')), '{}'::text[]) as languages,
    case when (row->>'max_clients') is null then null else (row->>'max_clients')::int end as max_clients
  from raw_rows r
  cross join org
  where trim(coalesce(row->>'email', '')) <> ''
)
insert into public.therapists (
  email,
  full_name,
  specialties,
  max_clients,
  first_name,
  middle_name,
  last_name,
  facility,
  employee_type,
  staff_id,
  supervisor,
  status,
  npi_number,
  medicaid_id,
  practitioner_id,
  taxonomy_code,
  time_zone,
  phone,
  street,
  city,
  state,
  zip_code,
  organization_id
)
select
  email,
  coalesce(nullif(full_name, ''), email),
  languages,
  coalesce(max_clients, 10),
  first_name,
  middle_name,
  last_name,
  facility,
  employee_type,
  staff_id,
  supervisor,
  status_value,
  npi_number,
  medicaid_id,
  practitioner_id,
  taxonomy_code,
  time_zone,
  phone,
  street,
  city,
  state,
  zip_code,
  organization_id
from prepared
on conflict (email)
do update set
  full_name = excluded.full_name,
  specialties = excluded.specialties,
  max_clients = excluded.max_clients,
  first_name = excluded.first_name,
  middle_name = excluded.middle_name,
  last_name = excluded.last_name,
  facility = excluded.facility,
  employee_type = excluded.employee_type,
  staff_id = coalesce(excluded.staff_id, public.therapists.staff_id),
  supervisor = excluded.supervisor,
  status = excluded.status,
  npi_number = excluded.npi_number,
  medicaid_id = excluded.medicaid_id,
  practitioner_id = excluded.practitioner_id,
  taxonomy_code = excluded.taxonomy_code,
  time_zone = excluded.time_zone,
  phone = excluded.phone,
  street = excluded.street,
  city = excluded.city,
  state = excluded.state,
  zip_code = excluded.zip_code,
  organization_id = excluded.organization_id;

